  return (
    <>

      <div style={{ minHeight: "calc(100vh - 100px)" }}>
        <h1>Cart</h1>
      </div>
      {cart?.map((item) => {
       <div>
       <span name="price">"{item.precio}"</span>
      </div>
        })}
      </>
    );
  };
export default Cart;
